import React from 'react';
import { GoogleLogin } from '@react-oauth/google';
import { Link } from 'react-router-dom';

const Login = ({ onSuccess, onFailure }) => {
    return (
        <>
        <div class="list-group">
  <Link to="#" class="list-group-item list-group-item-action active" >
    Contacts
  </Link>
  <Link to="#" class="list-group-item list-group-item-action">Groups</Link>
  <Link to="#" class="list-group-item list-group-item-action">A third link item</Link>
  <Link to="#" class="list-group-item list-group-item-action">A fourth link item</Link>
        <GoogleLogin
            onSuccess={onSuccess}
            onFailure={onFailure}
            scope="https://www.googleapis.com/auth/contacts.readonly"
        />
        </div>

        </>

    );
};

export default Login;
